.guide-wrapper {
	max-width: 1024px;
	margin: 0 auto;
	padding: 40px 0 100px;
}

.guide-title {
	text-align: center;
	margin-bottom: 30px;
	color: #000;
	font-weight: 700;
}



.row>* {
	// padding-left: 15px;
