	flex-direction: column;
   margin-bottom:  30px;
}

.card {
	border: 1px solid #dedede;
	margin-bottom: 20px;
	height: 100%;
	

	dt {
		background: #f4f5f9;
		padding: 10px;
	}

	dd {
		padding: 15px 15px;
	}

	.title,
	dt {
		font-weight: 700;
		color: #000;
		font-size: 18px;
	}

	.title-sub {
		font-size: 18px;
		font-weight: 500;
		margin-bottom: 5px;
		color: #000;
	}

	.title-sub-2 {
		font-size: 15px;
		font-weight: 500;
		margin-top: 10px;
		margin-bottom: 5px;
		color: #000;
	}

	.color-box {
		width: 100px;
		border-radius: 5px;
		display: inline-block;
		padding: 10px;
		color: #fff;
		text-align: center;
	}
}

.form-check-wrap {
	margin-top: 6px;
}

.guide-gatter-5 {
	>* {
		margin-right: 5px;

